import React from 'react';

import '../../styles/components/layout/Header.css';

const Header= (props)=>{
    return (
        <header>
            <div className='holder'></div>
            <img scr="img/logo.png" width={100} alt="plantasyotrashierbas"/> 
        </header>
    );
};



export default Header;
